let base = 'data:image/jpeg;base64,';


/**
 * 向仓库中上传一个文件 根据传入的仓库名，文件名以及该文件的内容将一个文件上传到仓库中
 *   url地址 :  /v1/leonid/static/uploadfile
 *   请求方式:  PUT
 *   参数 (红色为必传):
 Ø   bucketName  // 仓库名
 Ø   key  // 仓库中内的文件名
 Ø  pId  // 分组id
 */
httpServer.put({
    key: '/1.png',
    userToken: userToken,
    bucketName: 'yongche',
    file: base
}, config.leonidUrl + '/v1/leonid/static/uploadfile');


